import { Component } from "react";

class Guesnumber extends Component{
    render(){
        return(
        <div className="gues">
            <form>
            <label>Enter Number</label><br/>
            <input className="input" type="text" placeholder="Enter the name"/>
            <br>
            </br>
            <input type="submit" value="Check"/>
            <input type="reset" value="Restart"/>
            </form>
        </div>
            
        );
    }
}
export default Guesnumber;
